import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Bg from './images/Bg.jpg';

function Homepage() {
  return (
    <div className="text-white text-center font-serif gap-6 font-extrabold bg-cover min-h-screen" style={{ backgroundImage: `url(${Bg})` }}>
      <Header />
          <p className="text-6xl pt-7 bg-cover rounded-t-full rounded-b-full ">Welcome to my Blog Post Web</p>
          <h1 className="text-4xl">Chhon</h1>
          <h1 className="text-7xl">KimEang</h1>
          <p className="text-3xl">OW Student</p>
        <Footer />
    </div>
  );
}

export default Homepage;
